--DROP TABLE IF EXISTS def.service_identifiers;
--DROP SCHEMA IF EXISTS def;

drop table if exists service_identifiers;
CREATE TABLE
  service_identifiers (
    id character varying(36)  NOT NULL,
    id_grp character varying(36) NOT NULL,
    identifier_type character varying(50) NOT NULL,
    def_service_id character varying(200) NOT NULL,
    prop_key character varying(200) NOT NULL,
    prop_value character varying(200) NOT NULL,
    prop_is_identifying boolean NOT NULL,
    version_from integer NOT NULL,
    version_to integer NOT NULL,
    date_created timestamp without time zone NOT NULL,
    date_modified timestamp without time zone NOT NULL,
    config_id character varying(255) NOT NULL
  );
--,PRIMARY KEY (id, id_grp, prop_key, prop_value)
ALTER TABLE
  service_identifiers
ADD
  CONSTRAINT service_identifiers_pkey PRIMARY KEY (id, id_grp, prop_key, prop_value);





